import React from 'react';
import { BrowserRouter, Route, Link, Redirect } from 'react-router-dom';


export class GameOver extends React.Component {
    constructor(props) {
      super(props);
      this.winner = this.props.location.state.win;
      //console.log(this.props.location.win);
    }

    render() {
      return (
        <div
          className="winner"
        >
          <p>And the winner is: {this.winner}</p>
          <button>
              <Link to='/'>
              Play again!    
              </Link>
          </button>
        </div>
      );
    }
  }
